uint32_t f(uint32_t R, const unsigned char subKeys[6]) {
    // 将密钥转为uint64_t
    uint64_t K = 0;
    for (int i = 0; i < 6; i++) {
        K = (K << 8) | subKeys[i];
    }
    // 按字节进行E扩展
    uint64_t E = 0;
    for (int i = 3; i >= 0; i--) {
        uint8_t te = R & 0xFF;
        E |= Emax[i][te];
        R = R >> 8;
    }
    // 与子密钥模2加
    E = (E ^ K) & 0x0FFFFFFFFFFFF;
    // 按字节进行S替代
    uint8_t S[4] = {0};
    for (int i = 3; i >= 0; i--) {
        S[i] = 0;
        uint8_t block = E & 0x3F;
        S[i] |= S_box_table[i*2+1][block];
        E = E >> 6;
        block = E & 0x3F;
        S[i] |= (S_box_table[i*2][block] << 4);
        E = E >> 6;
    }
    // 按字节进行P置换
    uint32_t P = 0;
    for (int i = 0; i < 4; i++) {
        P |= Pmax[i][S[i]];
    }
    return P;
}
/**
 * @brief DES encrypt single block
 * @param[in] input plaintext, [length = DES_BLOCK_SIZE]
 * @param[in] subKeys subKeys
 * @param[out] output ciphertext, [length = DES_BLOCK_SIZE]
 */
void des_encrypt_block(const unsigned char *input, unsigned char subKeys[16][6], unsigned char *output) {
    // 按字节进行IP置换
    uint64_t LR = 0;
    for (int i = 0; i < 8; i++) {
        uint8_t M = input[i];
        LR |= IPmax[i][M];
    }

    uint32_t L = (LR >> 32) & 0x0FFFFFFFF;
    uint32_t R = LR & 0x0FFFFFFFF;
    // 16轮加密
    for (int i = 0; i < 16; i++) {
        uint32_t L_pre = L;
        L = R;
        R = L_pre ^ f(R, subKeys[i]);
    }
    // 合并L16和R16
    LR = ((uint64_t)R << 32) | L;

    // 按字节进行IP逆置换
    uint64_t C = 0;
    for (int i = 7; i >= 0; i--) {
        uint8_t tmp = LR & 0xFF;
        C |= IPmax_reverse[i][tmp];
        LR = LR >> 8;
    }

    // 将C写入output
    for (int i = 0; i < 8; i++) {
        output[7 - i] = (C >> (i * 8)) & 0xFF;
    }
}

/**
 * @brief DES decrypt single block
 * @param[in] input ciphertext, [length = DES_BLOCK_SIZE]
 * @param[in] subKeys subKeys
 * @param[out] output plaintext, [length = DES_BLOCK_SIZE]
 */
void des_decrypt_block(const unsigned char *input, unsigned char subKeys[16][6], unsigned char *output) {
    // 按字节进行IP置换
    uint64_t LR = 0;
    for (int i = 0; i < 8; i++) {
        uint8_t C = input[i];
        LR |= IPmax[i][C];
    }

    uint32_t L = (LR >> 32) & 0x0FFFFFFFF;
    uint32_t R = LR & 0x0FFFFFFFF;
    // 16轮加密
    for (int i = 0; i < 16; i++) {
        uint32_t L_pre = L;
        L = R;
        R = L_pre ^ f(R, subKeys[15-i]);
    }
    // 合并L16和R16
    LR = ((uint64_t)R << 32) | L;
    
    // 按字节进行IP逆置换
    uint64_t M = 0;
    for (int i = 7; i >= 0; i--) {
        uint8_t tmp = LR & 0xFF;
        M |= IPmax_reverse[i][tmp];
        LR = LR >> 8;
    }
    
    // 将M写入output
    for (int i = 0; i < 8; i++) {
        output[7 - i] = (M >> (i * 8)) & 0xFF;
    }
}